$_MODULE['<{ets_affiliatemarketing}prestashop>defines_e41c3d27e5f00685e5c8d592d762ee12'] = 'Cela permet aux sponsors de gagner des récompenses lorsque leurs amis parrainés achètent des produits. Soutenir le marketing multiniveau (les sponsors peuvent également gagner des récompenses lorsque des clients de tous les niveaux inférieurs achètent des produits)';
$_MODULE['<{ets_affiliatemarketing}prestashop>defines_a07a007d26416180aaa9bb8dd4e50a46'] = 'Ne récompensez que sur le commandes de';
