$_MODULE['<{ets_affiliatemarketing}prestashop>defines_d015964931b30fb9ab1699941561f531'] = 'Ceci afin de limiter le nombre de commandes que les sponsors gagneront en récompense en limitant le nombre d\'amis parrainés directement que les sponsors peuvent gagner des récompenses sur leurs commandes. Lorsqu\'une commande est passée par un client en dehors de cette limite, tous les sponsors (quel que soit leur niveau) ne recevront aucune récompense. Laissez le champ vide si vous souhaitez récompenser les sponsors lorsque l\'un des amis qu\'ils parrainent achète des produits dans votre boutique.';
$_MODULE['<{ets_affiliatemarketing}prestashop>defines_ba1053f5c3549e600c5213852b6ef6c0'] = 'Ne récompensez que les';
