$_MODULE['<{ets_affiliatemarketing}prestashop>defines_84aebb7d0db493ae8150eb880aa48f36'] = 'C\'est pour limiter le nombre de commandes que les sponsors gagneront en récompense en limitant le nombre de commandes à récompenser pour les sponsors (tous niveaux) de chaque ami. Laissez le champ vide si vous souhaitez récompenser les sponsors de toutes les commandes de leurs amis.';
$_MODULE['<{ets_affiliatemarketing}prestashop>defines_9d1cdef34c895721ee018d787ebe77e2'] = 'Total de commande minimum de ami parrainé requis pour obtenir une récompense';
$_MODULE['<{ets_affiliatemarketing}prestashop>defines_77bb6510c2972147d51db097c8ebfb9d'] = 'Appliquer à la commande d\'un ami du sponsor. C\'est pour vous assurer de gagner plus que la récompense que vous donnez. Laissez vide pour donner la récompense au sponsor pour n\'importe quel montant de la commande de leur ami';
$_MODULE['<{ets_affiliatemarketing}prestashop>defines_fc111eb9b9d65fbe3867a2a6fa32a029'] = 'Comment calculer la récompense d\'un sponsor lorsque ses amis achètent des produits?';
