$_MODULE['<{ets_affiliatemarketing}prestashop>defines_19ba7d945f7bf95867cde5e6ece03c60'] = 'Il s\'agit du total maximum d\'argent que vous souhaitez payer pour le système de parrainage quand une commande est générée, calculé en pourcentage basé sur le coût total de la commande. Ceci afin de vous assurer que vous ne paierez pas trop de frais de marketing lorsqu\'une commande est générée par le système de parrainage. Au total, combien voudriez-vous payer aux sponsors pour chaque commande de leur ami? Laisser ce champ vide cessera de récompenser tous les sponsors lorsqu’une nouvelle commande est générée.';
$_MODULE['<{ets_affiliatemarketing}prestashop>defines_826978b762ea6f023206a4f4ed7971ed'] = 'Coût du sponsor (montant fixe)';
$_MODULE['<{ets_affiliatemarketing}prestashop>defines_3fd02012ffcc7fcc913610e80ba41f31'] = 'Il s\'agit du total maximum d\'argent que vous souhaitez payer pour le système de parrainage lorsqu\'une commande est générée. Ceci afin de vous assurer que vous ne paierez pas autant de frais de marketing lorsqu\'une commande est générée par le système de parrainage. Combien au total voudriez-vous payer aux sponsors pour chaque commande de leur ami ?';
