$_MODULE['<{ets_affiliatemarketing}prestashop>defines_1b3e34dea2a630215ffd3e14efce91db'] = 'Activez cette option si vous souhaitez donner l’argent restant du \"Coût du sponsor\" (si après calcul de la récompense pour tous les niveaux de sponsor définis ci-dessus) au \"Niveau 1\" (sponsor direct). Sinon, le reste de l\'argent ne sera pas donné à des sponsors, gardez-le pour vous!';
